import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Importando o Router
import Header from './componentes/header/header';
import Apresentacao from './componentes/apresentacao-body/apresentacao';
import Video from './componentes/video-sobre/video';
import Resumo from './componentes/resumo/Resumo';
import Informacoes from './componentes/informacoes/informacoes';
import ProjetosInicio from './componentes/projetos-inicio/projetos-inicio'; // Importando o novo componente

function App() {
  return (
    <Router>
      <section className="initial">
        <Header />
        <Routes>
          <Route path="/" element={<Apresentacao />} />
          <Route path="/sobre" element={<Apresentacao />} />
          <Route path="/projetos" element={<ProjetosInicio />} /> {/* Nova rota para "Projetos" */}
          <Route path="/blog" element={<Resumo />} />
        </Routes>
      </section>

      <section className="video">
        <Video />
      </section>

      <section className="resumo">
        <Resumo />
      </section>

      <section className="informacoes">
        <Informacoes />
      </section>
    </Router>
  );
}

export default App;
